{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/122/", "subtitle": "122\u653e\u8ab2\u5f8c\u306e\u5225\u884c\u52d5", "discourse": ["\u5468\u304f\u3093\u3001\u4eca\u65e5\u5bc4\u308b\u3068\u3053\u308d\u3042\u308b\u306e\u3067\u5225\u3005\u306b\u5e30\u3063\u3066\u3044\u3044\u3067\u3059\u304b\uff1f", "\u3093\u3001\u5206\u304b\u3063\u305f\u3002\u3058\u3083\u3042\u307e\u305f\u5f8c\u3067", "\u2026\u2026\u4ed6\u306e\u5973\u306e\u5b50\u3068\u5e30\u3063\u305f\u308a\u3057\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u4ffa\u304c\u3059\u308b\u3068\u601d\u3046\u304b\uff1f", "\u3057\u306a\u3044\u3067\u3059\u3051\u3069\u3001\u5973\u306e\u5b50\u5074\u304b\u3089\u8a98\u308f\u308c\u308b\u53ef\u80fd\u6027\u304c\u3042\u308a\u307e\u3059\u306e\u3067\u3002\u2026\u2026\u305d\u306e\u3001\u99c4\u76ee\u3068\u306f\u8a00\u3044\u307e\u305b\u3093\u3051\u3069\u3001\u3084\u3067\u3059\u3002\u3053\u306e\u9593\u3001\u58f0\u304b\u3051\u3089\u308c\u3066\u307e\u3057\u305f\u3057\u2026\u2026", "\u304c\u3093\u3070\u308c\u30fc", "\u5927\u4e08\u592b\u3060\u3088\u3002\u771f\u663c\u3057\u304b\u898b\u3066\u306a\u3044\u3057\u3001\u8a98\u3044\u306b\u3082\u4e57\u3063\u305f\u308a\u3057\u306a\u3044\u3088\u3002\u3042\u3063\u3066\u5343\u6b73\u306b\u9023\u308c\u56de\u3055\u308c\u308b\u304f\u3089\u3044\u3060", "\u2026\u2026\u305d\u308c\u306a\u3089\u3044\u3044\u3067\u3059\u3051\u3069", "\u3042\u3068\u3001\u305d\u306e\u3001\u4e07\u304c\u4e00\u3067\u8aa4\u89e3\u3092\u62db\u304f\u306e\u306f\u5acc\u306a\u306e\u3067\u5148\u306b\u884c\u304d\u5148\u8a00\u3044\u307e\u3059", "\u5185\u7dd2\u306b\u3057\u306a\u304f\u3066\u3088\u3044\u3082\u306e\u306a\u306e\u304b\uff1f", "\u306f\u3001\u306f\u3044", "\u305d\u3001\u305d\u306e\u2026\u2026\u304a\u8cb7\u3044\u7269\u306b\u3001\u884c\u3063\u3066\u304d\u307e\u3059", "\u305d\u3046\u306a\u306e\u304b\uff1f\u3067\u3082\u5225\u306b\u6065\u305a\u304b