{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/112/", "subtitle": "112\u604b\u4eba\u3068\u306f ", "discourse": ["\u4f55\u304b\u304a\u60a9\u307f\u3067\uff1f", "\u3042\u30fc\u3044\u3084\u3001\u3046\u3093\u3001\u307e\u3042", "\u79c1\u3067\u3088\u3051\u308c\u3070\u76f8\u8ac7\u306b\u4e57\u308a\u307e\u3059\u3088\uff1f", "\u4efb\u305b\u3066\u304f\u3060\u3055\u3044", "\u2026\u2026\u306a\u3042\u771f\u663c", "\u306f\u3044", "\u3042\u306e\u3055\u3001\u4ffa\u9054\u3001\u305d\u306e\u2026\u2026\u4ed8\u304d\u5408\u3044\u59cb\u3081\u305f\u8a33\u3060\u3051\u3069", "\u306f\u3044", "\u2026\u2026\u4ed8\u304d\u5408\u3046\u3063\u3066\u3001\u5177\u4f53\u7684\u306b\u306a\u306b\u3059\u308c\u3070\u3044\u3044\u3093\u3060", "\u3048\uff1f", "\u3044\u3001\u3044\u3084\u3001\u4ed8\u304d\u5408\u3046\u306e\u3068\u304b\u521d\u3081\u3066\u3060\u3057\u2026\u2026\u5c11\u5973\u6f2b\u753b\u3068\u304b\u604b\u611b\u5c0f\u8aac\u3068\u304b\u8aad\u307e\u306a\u3044\u304b\u3089\u3055\u3002\u3042\u3093\u307e\u3001\u5177\u4f53\u7684\u306b\u3069\u3046\u3053\u3046\u3059\u308b\u3063\u3066\u306e\u304c\u5206\u304b\u3089\u306a\u3044\u3068\u3044\u3046\u304b", "\u2026\u2026\u305d\u3001\u305d\u3046\u3044\u3048\u3070", "\u4f55\u304b\u601d\u3044\u5f53\u305f\u308b\u4e8b\u306f\u3042\u308b\u304b\uff1f", "\u2026\u2026\u624b\u3092\u7e4b\u3050\u3068\u304b\uff1f", "\u666e\u6bb5\u304b\u3089\u3057\u3066\u308b\u306a", "\u304a\u4f11\u307f\u3092\u4e00\u7dd2\u306b\u904e\u3054\u3059\u3068\u304b", "\u65e5\u5e38\u3060\u306a", "\u304a\u3067\u304b\u3051\u3059\u308b\u3068\u304b", "\u307e\u3042\u3084\u3063\u3066\u308b\u306a", "\u304e\u3085\u3063\u3068\u3059\u308b\u3068\u304b", "\u3084\u3063\u3066\u308b", "\u2026\u2026\u305d\u306e\u3001\u8a00\u3044\u306b\u304f\u3044\u3068\u3044\u3046\u304b\u3001\u8a00\u3046\u306e\u304c\u6065\u305a\u304b\u3057\u3044\u306e\u3067\u3059\u3051\u3069\u2026\u2026\u306