{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/89/", "subtitle": "89\u30ab\u30e9\u30aa\u30b1\u3068\u7df4\u7fd2", "discourse": ["\u3055\u3066\u3001\u4e00\u6628\u65e5\u306e\u4e8b\u306b\u3064\u3044\u3066\u3061\u3087\u3063\u3068\u805e\u304b\u305b\u3066\u3082\u3089\u3044\u305f\u3044\u304b\u306a", "\u3042\u30fc\u3042\u3001\u3070\u308c\u3066\u3089", "\u2026\u2026\u5225\u306b\u5927\u3057\u305f\u95a2\u4fc2\u3058\u3083\u306a\u3044\u3088\u3002\u6a39\u3068\u5343\u6b73\u306f\u4e0d\u6e2c\u306e\u4e8b\u614b\u3067\u77e5\u3063\u3066\u3044\u305f\u304c\u3001\u4ffa\u3068\u771f\u663c\u306f\u96a3\u306b\u4f4f\u3093\u3067\u308b\u3002\u3053\u308c\u306f\u672c\u5f53\u306b\u5076\u7136\u3060\u3002\u305d\u3053\u3067\u307e\u3042\u3061\u3087\u3063\u3068\u3057\u305f\u4e8b\u304c\u304d\u3063\u304b\u3051\u3067\u4ef2\u826f\u304f\u306a\u3063\u305f\u3063\u3064\u30fc\u304b", "\u4ef2\u826f\u304f\u306a\u3063\u3066\u4e8c\u4eba\u304d\u308a\u3067\u51fa\u639b\u3051\u305f\u3068", "\u307e\u3042", "\u9580\u8107\u304c\u601d\u3063\u3066\u308b\u3088\u3046\u306a\u4ef2\u3058\u3083\u306a\u3044\u3088", "\u85e4\u5bae\u304c\u8a00\u3046\u3088\u3046\u306a\u3082\u306e\u3067\u3082\u306a\u3044\u6c17\u304c\u3059\u308b\u3093\u3060\u3051\u3069", "\u3042\u306e\u306a\u3042", "\u4ef2\u826f\u304f\u3069\u3053\u308d\u3058\u3083\u6e08\u307e\u306a\u3044\u3093\u3060\u3051\u3069\u306a\u3001\u5468\u9054\u306e\u72b6\u614b\u3002\u690e\u540d\u3055\u3093\u306b\u6bce\u65e5\u3054\u98ef\u4f5c\u308a\u306b\u304d\u3066\u3082\u3089\u3063\u3066\u308b\u306e\u306b\u306a", "\u3048\uff1f", "\u6a39", "\u305d\u306e\u5185\u30d0\u30ec\u308b\u3060\u308d\u3046\u3057\u65e9\u3081\u306b\u8a00\u3063\u3066\u304a\u3044\u305f\u65b9\u304c\u3044\u3044\u3060\u308d", "\u2026\u2026\u901a\u3044\u59bb\uff1f", "\u9055\u3046\u3002\u4e00\u4eba\u66ae\u3089\u3057\u3060\u304b\u3089\u98df\u8cbb\u6298\u534a\u3067\u4e8c\u4eba\u5206\u4f