{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/67/", "subtitle": "67\u5929\u4f7f\u69d8\u3068\u65b0\u5b66\u5e74", "discourse": ["\u4eca\u5e74\u306f\u52e2\u63c3\u3044\u3060\u306a", "\u690e\u540d\u3055\u3093\u3068\u4e00\u7dd2\u306e\u30af\u30e9\u30b9\u3060\uff01", "\u738b\u5b50\u3068\u30af\u30e9\u30b9\u540c\u3058\u3060\u3063\u305f\uff01", "\u9a12\u304c\u3057\u3044\u30af\u30e9\u30b9\u306b\u306a\u308a\u305d\u3046\u3060\u306a", "\u3088\u3001\u6a39\u3068\u85e4\u5bae\u306f\u4eca\u5e74\u3082\u4e00\u7dd2\u306e\u30af\u30e9\u30b9\u3060\u306a", "\u4eca\u5e74\u3082\u512a\u592a\u3068\u4e00\u7dd2\u3060\u306a\u3042\u3002\u4e2d\u5b66\u751f\u306e\u6642\u304b\u3089\u542b\u3081\u308b\u3068\u4e09\u5e74\u9023\u7d9a\u3060\u308f", "\u305d\u3046\u306a\u306e\u304b\uff1f", "\u3093\u3002\u540c\u4e2d\u3060\u304b\u3089", "\u4eca\u5e74\u3082\u3088\u308d\u3057\u304f\u306a\u30fc\u85e4\u5bae", "\u304a\u3046", "\u304a\u306f\u30fc\uff01\u4eca\u5e74\u306f\u4e00\u7dd2\u306e\u30af\u30e9\u30b9\u3060\u306d\u30fc\uff01", "\u304a\u306f\u3088\u3046\u3002\u4eca\u65e5\u306f\u6a39\u3068\u6765\u306a\u304b\u3063\u305f\u3093\u3060\u306a", "\u3046\u3093\u3001\u5bdd\u574a\u3057\u305f\u30fc\u3002\u3084\u30fc\u65b0\u5b66\u671f\u3063\u3066\u3046\u3063\u304b\u308a\u5fd8\u308c\u304b\u3051\u3066\u3066\u30de\u30de\u306b\u8d77\u3053\u3057\u3066\u3082\u3089\u3063\u305f\u3093\u3060\u3088\u306d\u30fc\u3002\u3044\u3063\u304f\u3093\u306f\uff1f", "\u3055\u3063\u304d\u81ea\u8ca9\u6a5f\u306b\u5411\u304b\u3063\u3066\u3063\u305f", "\u304a\u3051\u30fc\u3002\u30df\u30eb\u30af\u30c6\u30a3\u30fc\u983c\u3093\u3069\u3053\u3002\u3042\u3063\u3001\u307e\u3072\u308b\u3093\u307e\u3072\u308b\u3093\uff01\u4eca\u5e74\u306f\u4e00\u7dd2\u306e\u30af\u30e9\u30b9\u3060\u304b\u3089\u3088\u308d\u3057\u304f\u306d\u30fc\uff01", "\u4eca\u65e5\u3069\u3046\u305b\u65e9\u3044\u3057\u5e30\u308a\u306b\u30af\u30ec\u