{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/57/", "subtitle": "57\u4fee\u4e86\u5f0f\u3068\u6a39\u306e\u983c\u307f\u4e8b", "discourse": ["\u2026\u2026\u3042\u30fc\u80a9\u51dd\u3063\u305f", "\u6821\u9577\u8a71\u9577\u3044\u304b\u3089\u306a\u3042", "\u306a\u3042\u306a\u3042\u5468\u304f\u3093\u3084", "\u306a\u3093\u3060\u3088", "\u304a\u524d\u3001\u660e\u65e5\u304b\u3089\u6687\uff1f", "\u307e\u3042\u6687\u3060\u306a", "\u3046\u3093\u3046\u3093\u3001\u3060\u3068\u601d\u3063\u3066\u305f\u3088\u3002\u3088\u304b\u3063\u305f\u3088\u304b\u3063\u305f", "\u2026\u2026\u306a\u3093\u3060\u3088", "\u2026\u2026\u305d\u308c\u306f\uff1f", "\u7740\u66ff\u3048", "\u4f55\u6545\u306b", "\u6cca\u3081\u3066", "\u3042\u306e\u3055\u3001\u304a\u524d\u307b\u3046\u308c\u3093\u305d\u3046\u77e5\u3063\u3066\u308b\u304b", "\u77e5\u3063\u3066\u308b\u77e5\u3063\u3066\u308b\u3001\u8a2a\u554f\u9023\u591c\u9a12\u97f3\u3060\u308d", "\u305d\u308c\u5358\u306a\u308b\u591c\u9593\u306e\u8fd1\u6240\u8ff7\u60d1\u3060\u99ac\u9e7f\u91ce\u90ce\u3002\u9a12\u3050\u3064\u3082\u308a\u306a\u306e\u304b", "\u5197\u8ac7\u3060\u3088\u3002\u6cca\u3081\u3066\u3063\u3066\u306e\u306f\u307b\u3093\u3068\u3060\u3051\u3069", "\u671d\u89aa\u7236\u3068\u55a7\u5629\u3057\u305f", "\u2026\u2026\u5343\u6b73\u306e\u4e8b\u3067\uff1f", "\u3093\u3002\u3046\u3061\u306e\u89aa\u7236\u6012\u308b\u3068\u6570\u65e5\u7f6e\u304b\u306a\u3044\u3068\u8a71\u805e\u3044\u3066\u304f\u308c\u306a\u304f\u3066\u3055\u3002\u3061\u3043\u306e\u5bb6\u306b\u6cca\u307e\u308b\u306e\u306f\u99c4\u76ee\u3060\u308d\u3002\u3061\u3043\u306e\u4e21\u89aa\u306f\u53d7\u3051\u5165\u308c\u3066\u304f\u308c\u308b\u3068\u306f\u3044\u3048\u3001\u6d41\u77f3\u306b\u306a\u3042", "\u4ffa\u306a\u3089\u3044\u3044\u3063\u3066\u304b", "\u304a\u524d\u306a\u3089\u6cca\u3081\u3066\u304f\u308c\u308b\u3068\u601d\u3063\u3066", "\u2026\u2026\u