{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/37/", "subtitle": "37\u5929\u4f7f\u69d8\u3068\u5e74\u8d8a\u3057", "discourse": ["\u3042\u3068\u3001\u304b\u307c\u3061\u3083\u304c\u4f59\u3063\u3066\u305f\u306e\u3067\u3001\u3064\u3044\u3067\u306b\u5929\u3077\u3089\u306b\u3057\u3066\u304a\u304d\u307e\u3059\u306d", "\u304a\u30fc\u2026\u2026\u8c6a\u83ef\u306a\u5e74\u8d8a\u3057\u854e\u9ea6\u3060", "\u305f\u307e\u306b\u306f\u3053\u3046\u3044\u3046\u306e\u3082\u3044\u3044\u3067\u3057\u3087\u3046", "\u304a\u30fc", "\u3069\u3046\u305e\u53ec\u3057\u4e0a\u304c\u3063\u3066\u304f\u3060\u3055\u3044\u306a", "\u306f\u30fc\u2026\u2026\u3053\u308c\u305e\u5e74\u672b\u3063\u3066\u611f\u3058\u3060\u2026\u2026", "\u5e74\u8d8a\u3057\u854e\u9ea6\u3092\u98df\u3079\u308b\u3068\u4e00\u6c17\u306b\u5e74\u304c\u7d42\u308f\u308b\u3063\u3066\u5b9f\u611f\u304c\u6e67\u304d\u307e\u3059\u3088\u306d", "\u307b\u3093\u3068\u306a\u3002\u2026\u2026\u4eca\u5e74\u306f\u8272\u3005\u3042\u3063\u305f\u306a\u3042", "\u5468\u304f\u3093\u4e00\u4eba\u66ae\u3089\u3057\u59cb\u3081\u305f\u5e74\u3067\u3059\u304b\u3089\u306d\u3048\u3001\u305d\u308a\u3083\u3042\u5927\u5909\u3060\u3063\u305f\u3067\u3057\u3087\u3046", "\u304a\u524d\u306f\u3081\u3061\u3083\u304f\u3061\u3083\u6163\u308c\u3066\u308b\u3088\u306a", "\u307e\u3042\u3001\u4e00\u901a\u308a\u306a\u3093\u3067\u3082\u3053\u306a\u305b\u307e\u3059\u304b\u3089\u306d\u3002\u4f55\u3082\u51fa\u6765\u306a\u3044\u306e\u306b\u4e00\u4eba\u66ae\u3089\u3057\u3057\u3088\u3046\u3068\u3059\u308b\u5468\u304f\u3093\u304c\u30c0\u30e1\u30c0\u30e1\u306a\u306e\u3067\u3059\u3088\uff1f", "\u3050\u3063\u3002\u2026\u2026\u305d\u3046\u3060\u3051\u3069\u3055\u3042", "\u307b\u3093\u3068\u3001\u4ed5\u65b9\u306e\u306a\u3044\u4eba\u3067\u3059\u3088\u306d\u3001\u307e\u3063\u305f\u304f", "\u2026\u2026\u4eca\u5e74\u306f\u672c\u5f53\u306b\u4e16\u8a71\u30