{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/36/", "subtitle": "36\u5929\u4f7f\u69d8\u3068\u304a\u6b63\u6708\u6e96\u5099", "discourse": ["\u3042\u306e\u3001\u771f\u663c\u3055\u3093\u3084", "\u306a\u3093\u3067\u3059\u304b\uff1f", "\u2026\u2026\u4ffa\u4f55\u3082\u3057\u306a\u304f\u3066\u826f\u3044\u306e\u304b\uff1f", "\u305d\u3082\u305d\u3082\u305d\u3046\u3044\u3046\u306e\u3063\u3066\u4e8b\u524d\u4e88\u7d04\u8981\u308b\u304b\u3089\u7121\u7406\u3067\u3059", "\u5468\u304f\u3093\u3001\u306a\u306b\u3082\u3057\u306a\u304f\u3066\u3044\u3044\u306e\u3068\u304b\u4e0d\u5b89\u305d\u3046\u306b\u3057\u3066\u307e\u3059\u3051\u3069\u3001\u304a\u624b\u4f1d\u3044\u51fa\u6765\u308b\u306e\u3067\uff1f", "\u51fa\u6765\u307e\u305b\u3093", "\u3067\u3057\u3087\u3046\u306d\u3002\u90aa\u9b54\u3055\u308c\u308b\u3088\u308a\u306f\u5927\u4eba\u3057\u304f\u3057\u3066\u3044\u3066\u3082\u3089\u3063\u305f\u65b9\u304c\u697d\u3067\u3059", "\u6628\u65e5\u306f\u5bb6\u5177\u5bb6\u96fb\u52d5\u304b\u3057\u3066\u3057\u3063\u304b\u308a\u6383\u9664\u3057\u307e\u3057\u305f\u3057\u304a\u75b2\u308c\u3067\u3057\u3087\u3046\u304b\u3089\u3001\u3086\u3063\u304f\u308a\u3057\u3066\u3044\u3066\u304f\u3060\u3055\u3044", "\u3044\u3084\u30fc\u3001\u305d\u308c\u3067\u3082\u306a\u3093\u3068\u3044\u3046\u304b\u2026\u2026\u60aa\u3044\u306a\u3042\u3001\u3068", "\u5225\u306b\u6599\u7406\u597d\u304d\u3067\u3059\u304b\u3089\u82e6\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3088", "\u305d\u308c\u3067\u3082\u3055\u3042", "\u3044\u3044\u3093\u3067\u3059\u3088\u3001\u697d\u3057\u3044\u3067\u3059\u304b\u3089", "\u771f\u663c\u3001\u663c\u3054\u98ef\u8cb7\u3063\u3066\u304d\u305f\u305e", "\u308f\u3056\u308f\u3056\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3002\u305d\u3053\u307e\u3067\u624b\u304c\u56de\u3063\u3066\u306a\u304f\u3066\u7533\u3057\u8a33\u306a\u3044\u3067\u30