{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/28/", "subtitle": "28\u5929\u4f7f\u69d8\u306e\u30af\u30ea\u30b9\u30de\u30b9\u306e\u7d04\u675f", "discourse": ["\u30af\u30ea\u30b9\u30de\u30b9\u306e\u4e88\u5b9a\u3067\u3059\u304b\uff1f\u7279\u306b\u3042\u308a\u307e\u305b\u3093\u3051\u3069", "\u57fa\u672c\u7684\u306b\u3001\u79c1\u3068\u4ea4\u53cb\u306e\u3042\u308b\u540c\u6027\u306e\u7d1a\u53cb\u306f\u5927\u4f53\u5f7c\u6c0f\u304c\u5c45\u307e\u3059\u3088\u3002\u7537\u6027\u304b\u3089\u8a98\u308f\u308c\u3066\u3082\u304a\u65ad\u308a\u3057\u3066\u3044\u307e\u3059\u304b\u3089\u3001\u4e88\u5b9a\u306f\u3069\u3046\u3057\u3066\u3082\u7a7a\u304d\u307e\u3059\u306d", "\u7537\u5b50\u6d99\u76ee\u3060\u306a", "\u2026\u2026\u305d\u3093\u306a\u306b\u79c1\u3068\u904e\u3054\u3057\u305f\u3044\u3082\u306e\u306a\u306e\u3067\u3059\u304b\u306d", "\u3042\u308f\u3088\u304f\u3070\u304a\u8fd1\u3065\u304d\u306b\u306a\u308a\u305f\u3044\u3093\u3060\u308d", "\u306a\u3093\u306e\u305f\u3081\u306b\uff1f", "\u305d\u308a\u3083\u3001\u304a\u4ed8\u304d\u5408\u3044\u3057\u305f\u3044\u304b\u3089\u3067\u306f\uff1f", "\u4f55\u6545\u4ed8\u304d\u5408\u3044\u305f\u3044\u306e\u3067\u3057\u3087\u3046\u304b", "\u2026\u2026\u4ed8\u304d\u5408\u3063\u3066\u3042\u308c\u3053\u308c\u3057\u305f\u3044\u3093\u3058\u3083\u306a\u3044\u306e\u304b\u306d", "\u4e0d\u7d14\u3067\u3059\u306d", "\u307e\u3042\u3067\u3082", "\u305d\u3046\u3044\u3046\u3084\u3064\u3070\u3063\u304b\u308a\u3058\u3083\u306a\u3044\u3068\u601d\u3046\u304b\u3089\u3001\u3042\u3093\u307e\u7591\u3063\u3066\u3084\u308b\u306a\u3002\u304a\u524d\u306a\u3089\u3001\u7537\u304c\u5411\u3051\u3066\u304f\u308b\u8996\u7dda\u306e\u8cea\u304f\u3089\u3044\u5206\u304b\u308b\u3060\u308d", "\u305d\u3046\u3067\u3059\u306d\u3002\u5168\u54e1\u304c\u5168\u54e1\u4e0d\u57d2\u306a\u773c\u5dee\u3057\u3067\u898b\u3066\u304f\u308b\u8a33\u3067\u