{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/20/", "subtitle": "20\u5929\u4f7f\u69d8\u3068\u8a95\u751f\u65e5", "discourse": ["\u3093\u3002\u3084\u308b", "\u306a\u3093\u3067\u3059\u304b\u3053\u308c", "\u8a95\u751f\u65e5\u306a\u3093\u3060\u308d", "\u305d\u3046\u3067\u3059\u3051\u3069\u2026\u2026\u9006\u306b\u4f55\u3067\u77e5\u3063\u3066\u308b\u306e\u3067\u3059\u304b\u3002\u79c1\u3001\u8ab0\u306b\u3082\u8a00\u3063\u305f\u899a\u3048\u306a\u3044\u3093\u3067\u3059\u3051\u3069", "\u5b66\u751f\u8a3c\u90e8\u5c4b\u306b\u843d\u3068\u3057\u305f\u3053\u3068\u3042\u3063\u305f\u3060\u308d", "\u5225\u306b\u3001\u6c17\u306b\u3057\u306a\u304f\u3066\u3082\u3088\u304b\u3063\u305f\u306e\u306b\u3002\u79c1\u3001\u8a95\u751f\u65e5\u306a\u3093\u3066\u795d\u308f\u306a\u3044\u3067\u3059\u3057", "\u3042\u3063\u305d\u3002\u3058\u3083\u3042\u65e5\u9803\u306e\u611f\u8b1d\u306e\u5370\u3067\u3044\u3044\u3088\u3002\u4ffa\u304c\u52dd\u624b\u306b\u6069\u3092\u611f\u3058\u3066\u6e21\u3059\u3060\u3051\u3060\u304b\u3089", "\u2026\u2026\u958b\u3051\u3066\u3082\u3044\u3044\u306e\u3067\u3059\u304b\uff1f", "\u3093", "\u307e\u3042\u5927\u3057\u305f\u3082\u3093\u3067\u306a\u304f\u3066\u60aa\u3044\u3051\u3069\u306a\u3002\u5bb6\u4e8b\u3055\u305b\u3066\u308b\u3057\u3001\u4e7e\u71e5\u3059\u308b\u3060\u308d\u3002\u5302\u3044\u304c\u3064\u3044\u305f\u3084\u3064\u3082\u3042\u3063\u305f\u3051\u3069\u3001\u304a\u524d\u6301\u3063\u3066\u305d\u3046\u3060\u3063\u305f\u3057\u3002\u808c\u306b\u512a\u3057\u304f\u3066\u52b9\u304d\u76ee\u304c\u3042\u308b\u3089\u3057\u3044", "\u5b9f\u7528\u7684\u3067\u3059\u306d", "\u304a\u524d\u306f\u3069\u3061\u3089\u304b\u3068\u8a00\u3048\u3070\u5b9f\u7528\u6027\u306b\u91cd\u304d\u3092\u7f6e\u3044\u3066\u308b\u3060\u308d", "\u305d\u3046\u3067\u3059\u306d\u3002\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\u30