{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/13/", "subtitle": "13\u5929\u4f7f\u69d8\u3068\u30d9\u30bf\u306a\u5c55\u958b", "discourse": ["\u304a\u524d\u3053\u3093\u306a\u3068\u3053\u308d\u3067\u306a\u306b\u3057\u3066\u3093\u306e", "\u2026\u2026\u4f55\u3067\u3082\u306a\u3044\u3067\u3059", "\u3044\u3084\u4f55\u3067\u3082\u306a\u3044\u306a\u3089\u9014\u65b9\u306b\u66ae\u308c\u305f\u3088\u3046\u306a\u9854\u3067\u5ea7\u3063\u3066\u308b\u306a\u3088\u3002\u3069\u3046\u304b\u3057\u305f\u304b", "\u2026\u2026\u5225\u306b\u2026\u2026", "\u3066\u304b\u5236\u670d\u306b\u6bdb\u304c\u4ed8\u3044\u3066\u308b\u3051\u3069\u3001\u72ac\u304b\u732b\u3068\u904a\u3093\u3067\u305f\u306e\u304b", "\u904a\u3093\u3067\u307e\u305b\u3093\u3002\u305f\u3060\u3001\u6728\u306e\u4e0a\u3067\u7acb\u3061\u5f80\u751f\u3057\u3066\u3044\u305f\u732b\u3092\u4e0b\u308d\u3057\u3066\u3042\u3052\u305f\u3060\u3051\u3067\u3059", "\u306a\u3093\u3066\u30d9\u30bf\u306a\u4e8b\u3092\u3002\u2026\u2026\u3042\u30fc\u305d\u3046\u3044\u3046\u4e8b\u304b", "\u3048\uff1f", "\u305d\u3053\u3067\u5f85\u3063\u3066\u308d\u3002\u7d76\u5bfe\u52d5\u304f\u306a\u3088", "\u690e\u540d\u3001\u30bf\u30a4\u30c4\u8131\u3052", "\u306f\uff1f", "\u3044\u3084\u305d\u3093\u306a\u58f0\u3055\u308c\u3066\u3082\u2026\u2026\u307b\u3089\u3001\u30d6\u30ec\u30b6\u30fc\u304b\u3051\u308b\u3057\u5f8c\u308d\u5411\u3044\u3066\u308b\u304b\u3089\u30bf\u30a4\u30c4\u8131\u3052\u3002\u3068\u308a\u3042\u3048\u305a\u60a3\u90e8\u51b7\u3084\u3057\u3066\u6e7f\u5e03\u8cbc\u308b\u304b\u3089", "\u2026\u2026\u4f55\u3067\u5206\u304b\u3063\u305f\u306e\u3067\u3059\u304b", "\u30ed\u30fc\u30d5\u30a1\u30fc\u7247\u8db3\u3060\u3051\u8131\u304e\u304b\u3051\u3060\u3057\u5fae\u5999\u306b\u8db3\u9996\u306e\u592a\u3055\u9055\u3046\u3002\u3042\u3068\u305d\u3053\u304b\u3089\u7acb\u3068\u3046\u3068\u3057\u306a\u3044\u304b\u3089\u306a\u30