{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8440fe/2/", "subtitle": "02\u5929\u4f7f\u69d8\u306e\u7533\u3057\u51fa", "discourse": ["\u5468\u3001\u9f3b\u3046\u308b\u3055\u3044", "\u304a\u524d\u3053\u305d\u3046\u308b\u3055\u3044", "\u6628\u65e5\u307e\u3067\u5143\u6c17\u3060\u3063\u305f\u308d\u304a\u524d", "\u96e8\u306b\u6fe1\u308c\u305f", "\u30c9\u30f3\u30de\u30a4\u3002\u3064\u30fc\u304b\u6628\u65e5\u5098\u6301\u3063\u3066\u306a\u304b\u3063\u305f\u3063\u3051", "\u2026\u2026\u4eba\u306b\u6e21\u3057\u305f", "\u3042\u3093\u306a\u96e8\u964d\u3063\u3066\u305f\u306e\u306b\u8cb8\u3057\u3061\u307e\u3046\u3068\u304b\u3001\u304a\u4eba\u597d\u3057\u904e\u304e\u306a\u3044\u304b\uff1f", "\u3057\u3083\u30fc\u306d\u3048\u3060\u308d\u3001\u6e21\u3057\u3061\u307e\u3063\u305f\u3093\u3060\u304b\u3089", "\u308f\u3056\u308f\u3056\u98a8\u90aa\u5f15\u304f\u30ea\u30b9\u30af\u80cc\u8ca0\u3063\u3066\u307e\u3067\u8ab0\u306b\u6e21\u3057\u305f\u3093\u3060\u3088", "\u2026\u2026\u901a\u308a\u3059\u304c\u308a\u306e\u8ff7\u5b50\u306e\u5b50\u4f9b\uff1f", "\u304a\u512a\u3057\u3044\u3053\u3063\u305f", "\u3067\u3082\u307e\u3042\u3001\u5098\u8cb8\u3057\u305f\u306b\u305b\u3088\u4f55\u306b\u305b\u3088\u3001\u304a\u524d\u305d\u306e\u5f8c\u9069\u5f53\u306b\u4f53\u62ed\u3044\u3066\u7d42\u308f\u3063\u305f\u3060\u308d\u3002\u305d\u3063\u3061\u304c\u539f\u56e0\u306a\u6c17\u304c\u3059\u308b\u304c", "\u2026\u2026\u4f55\u3067\u5206\u304b\u308b\u3093\u3060\u3088", "\u304a\u524d\u306e\u4e0d\u6442\u751f\u5177\u5408\u306f\u304a\u524d\u3093\u3061\u884c\u3063\u305f\u3089\u3059\u3050\u5206\u304b\u308b\u308f", "\u4eca\u65e5\u306f\u3055\u3063\u3055\u3068\u5bb6\u306b\u5e30\u3063\u3066\u65e9\u304f\u4f11\u3080\u3093\u3060\u306a\u3002\u571f\u65e5\u3042\u308b\u3057\u3001\u3055\u3063\u3055\u3068\u6cbb\u3057\u3066\u3053\u3044", "\u305d\u3046\u3059\u308b\u308f\u2026\u2026", "\u305b\u308